row.value:
Formatul de Tipărire al adresei definieşte formatul utilizat la tipărirea adreselor. Se utilizează următoarele notaţii:
@C@=Localitate (City);
@P@=Postal;
@A@=Adresă suplimentară (PostalAdd);
@R@=Judeţ (Region).

Reţineţi că în funcţie de acest format se determină care câmpuri se vor afişa în fereastra de editare a adresei.
De exemplu, dacă formatul este "@C@ @P@" atunci în fereastră nu se va afişa campul de editare a judeţului/regiunii, chiar dacă ţara are regiuni.

The optional Local Address Print format defines the format to be used when this address prints for the Country.  If defined, this format is used for printing the address for the country rather then the standard address format.
Se folosesc următoarele notaţii:
 @C@=Oraş
  @P@=Postal
  @A@=PostalAdd
  @R@=Judeţ
